import PropTypes from "prop-types";

const Button = ({ text, color }) => {
  return (
    <button onc className="btn" style={{ backgroundColor: color }}>
      {text}
    </button>
  );
};

Button.defaultProps = {
  color: "steelblue",
};
Button.propTypes = {
  text: PropTypes.string,
  color: PropTypes.string,
};
export default Button;
